text:
we all want to show someone special how we feel about them. it does not have to be a spouse or romantic love...imagine receiving the gift of an event? 
for today only when you purchase the event ticket for yourself and someone else they are 50% off. give the gift of learning. that's right, show someone you know who could benefit from getting valuable training and knowledge from 6 experts:

sherri - #metoo #movement, how current provincial legislation impacts both employee and employer by allowing women to come forward without fear!

employee engagement - we all know that we stay in our jobs when we feel heard and valued, but how to we keep our employees feeling this way? i'll highlight some suggestions.

#cannabis - legislation was passed to legalize the use of recreational marijuana but what does that mean? 
samantha kris will provide you specific ways to embrace change;

stephanie erickson offers her insight on what it means to bring mental health to the forefront in the workplace;

robert wise will demonstrate how to set goals;

ivan rubio explains the benefits of emotional awareness and the pitfalls that come from not being in-tune with your emotions at work;

robin glance shares her views on total wellness and it's added value to your employees and yourself.

use valentine's day special, link in bio. 
#humanresources #westisland #career #work #fundraiser #valentinesdaygift #love #loveyourself #giveaway #givethegiftoflove #montreal #westisland #westislandmontreal #healthcare

